"use strict";(self.webpackChunkdoc_source=self.webpackChunkdoc_source||[]).push([[8920],{7824:function(e){e.exports=JSON.parse('{"blogPosts":[{"id":"Raffle","metadata":{"permalink":"/News/Raffle","source":"@site/News/2022-03-14-Raffle.md","title":"Raffle: Win a Free Quarto","description":"asdf","date":"2022-03-14T00:00:00.000Z","formattedDate":"March 14, 2022","tags":[],"truncated":false,"authors":[],"frontMatter":{"slug":"Raffle","title":"Raffle: Win a Free Quarto","tags":[],"hide_table_of_contents":true},"nextItem":{"title":"New Beta Software Channel","permalink":"/News/Beta_Software"}},"content":"import {Column, Row, Header} from \'../src/lib/format.js\'\\n\\n<Row><Column>\\n\\n![asdf](../static/img/Logo2-qNimble-DarkBackground.png)\\n\\n</Column><Column>\\n\\n![asdf](../static/img/VescentNameAndMark.svg)\\n\\n</Column></Row>\\n\\nIn partnership with [Vescent](https://vescent.com), *qNimble* is raffling off a free *Quarto*. To enter, please fill out for [entry form](/Raffle) describing how you would use the *Quarto*. Make sure to use your professional e-mail address as we are not accepting entries from @gmail.com and the like. Also, if you entered the raffle on Vescent\'s website, it is the same raffle, so no need to create a duplicate entry. The winner will be announced around May 16th. \\n\\nBy entering, you agree that *qNimble* and Vescent may, if you win, use your name and institution in promotional material. Please see [Raffle Terms and Conditions](RaffleTerms) for full contest details."},{"id":"Beta_Software","metadata":{"permalink":"/News/Beta_Software","source":"@site/News/2022-03-11-BetaSoftware.md","title":"New Beta Software Channel","description":"Want to get the latest Arduino Quarto software? Then change the board mananger URL from https://qnimble.com/packageqnimbleindex.json to","date":"2022-03-11T00:00:00.000Z","formattedDate":"March 11, 2022","tags":[],"truncated":false,"authors":[{"name":"BLuey","title":"Founder, qNimble","url":"https://www.linkedin.com/in/benluey","imageURL":"../img/benluey.jfif"}],"frontMatter":{"slug":"Beta_Software","title":"New Beta Software Channel","author":"BLuey","author_title":"Founder, qNimble","author_url":"https://www.linkedin.com/in/benluey","author_image_url":"../img/benluey.jfif","tags":[]},"prevItem":{"title":"Raffle: Win a Free Quarto","permalink":"/News/Raffle"},"nextItem":{"title":"Quarto now supports SD Cards","permalink":"/News/SDCard_support"}},"content":"Want to get the latest Arduino Quarto software? Then change the board mananger URL from `https://qnimble.com/package_qnimble_index.json` to \\n\\n```\\nhttps://qnimble.com/package_qnimble_beta_index.json\\n```\\n\\nThen restart the Arduino IDE and when you go to the board manager, you will see options to install beta versions of our latest software.\\n\\n<img className=\\"center\\" src=\\"../img/Arduino-BetaChannels.png\\"/>\\n\\nFor detailed instructions, follow the [Quick Start Guide](/Quarto/Quick_Start) but use the beta URL listed above. For information about the latest (beta and released) software and new features, see the [announcements page on the forum](https://forum.qnimble.com/t/announcements)."},{"id":"SDCard_support","metadata":{"permalink":"/News/SDCard_support","source":"@site/News/2022-03-07-SDcard-support.md","title":"Quarto now supports SD Cards","description":"With the release of the latest 1.2.x of the board software package for the Quarto, recent versions of the Quarto now support reading and writing to the SD card. All Quarto\'s shipped after in Febuarary 2022 or later fully support the SD card.","date":"2022-03-07T00:00:00.000Z","formattedDate":"March 7, 2022","tags":[],"truncated":false,"authors":[{"name":"BLuey","title":"Founder, qNimble","url":"https://www.linkedin.com/in/benluey","imageURL":"../img/benluey.jfif"}],"frontMatter":{"slug":"SDCard_support","title":"Quarto now supports SD Cards","author":"BLuey","author_title":"Founder, qNimble","author_url":"https://www.linkedin.com/in/benluey","author_image_url":"../img/benluey.jfif","tags":[]},"prevItem":{"title":"New Beta Software Channel","permalink":"/News/Beta_Software"},"nextItem":{"title":"Quarto Back in Stock","permalink":"/News/InStock"}},"content":"With the release of the latest 1.2.x of the board software package for the *Quarto*, recent versions of the *Quarto* now support reading and writing to the SD card. All *Quarto*\'s shipped after in Febuarary 2022 or later fully support the SD card. \\n\\nTo use the SD card, first in the Arduino IDE, go to Boards Manager and install the latest (1.2.x or higher) version of \\"qNimble iMXRT Boards by qNimble\\"\\n\\n<img className=\\"center\\" src=\\"../img/arduino-board-support-1.2.x.png\\"/>\\n\\nOnce installed, open the UsageAndBenchmark example under SD,\\n\\n<img className=\\"center\\" src=\\"../img/arduino-example-sd-usage.png\\"/>\\n\\nThen you can put a SD card in the Quarto and run the example to do some basic operations and to benchmark the SD card. Or look at the example code to see how to list files, change directories, read and write files, etc.\\n\\nIf you aren\'t sure what version of the Quarto you have and if it supports the SD card, open the DeviceInfo example under Testing:\\n\\n<img className=\\"center\\" src=\\"../img/arduino-example-deviceinfo.png\\"/>\\n\\nAnd when you run it, the output on the Serial Monitor should look something like:\\n\\n ```\\n Quarto Device Information\\n SN: 516\\n Device ID: qN-101.3.1\\n Firmware Revision: 1.26.46\\n ```\\n\\nIf you see a Device ID of qN-101.3.1 or higher, you are ready to use the SD card. If you have qN-101.1.X or qN-101.2.X, please [contact *qNimble*](/Contact) about your options for using the SD card with the *Quarto*."},{"id":"InStock","metadata":{"permalink":"/News/InStock","source":"@site/News/2022-02-21-instock.md","title":"Quarto Back in Stock","description":"I\'m excited to announce that the Quarto is back in stock! Strong initial sales causes the Quarto to sell out 3 weeks after our product launch. And unfortunately the global chip shortage delayed getting more Quartos made, but they are finally here. And going forward, we will do our best to navigate these supply-chain challenges to keep the Quarto in stock. I want to thank everyone who ordered a Quarto and did not receive it promptly for their patience.","date":"2022-02-21T00:00:00.000Z","formattedDate":"February 21, 2022","tags":[],"truncated":false,"authors":[{"name":"BLuey","title":"Founder, qNimble","url":"https://www.linkedin.com/in/benluey","imageURL":"../img/benluey.jfif"}],"frontMatter":{"slug":"InStock","title":"Quarto Back in Stock","author":"BLuey","author_title":"Founder, qNimble","author_url":"https://www.linkedin.com/in/benluey","author_image_url":"../img/benluey.jfif","tags":[]},"prevItem":{"title":"Quarto now supports SD Cards","permalink":"/News/SDCard_support"},"nextItem":{"title":"Sorry: Ignored Messages","permalink":"/News/Ignored_Messages"}},"content":"I\'m excited to announce that the *Quarto* is back in stock! Strong initial sales causes the *Quarto* to sell out 3 weeks after our product launch. And unfortunately the [global chip shortage](https://en.wikipedia.org/wiki/2020\u20132022_global_chip_shortage) delayed getting more *Quartos* made, but they are finally here. And going forward, we will do our best to navigate these supply-chain challenges to keep the *Quarto* in stock. I want to thank everyone who ordered a *Quarto* and did not receive it promptly for their patience."},{"id":"Ignored_Messages","metadata":{"permalink":"/News/Ignored_Messages","source":"@site/News/2022-01-03-ignored-messages.md","title":"Sorry: Ignored Messages","description":"If you tried to contact qNimble via our contact us web-form from late November through early December and didn\'t hear from us, I\'m afraid it is because we lost your message. When you use the contact us web-form, an e-mail is sent to us and in late November we switched e-mail providers causing these e-mails to get blocked until we later updated some security-related email settings. Frustratingly, submissions did get an auto-reply e-mail from us saying we had received the message and would get back to you shortly, but this sadly was not that case.","date":"2022-01-03T00:00:00.000Z","formattedDate":"January 3, 2022","tags":[],"truncated":false,"authors":[{"name":"BLuey","title":"Founder, qNimble","url":"https://www.linkedin.com/in/benluey","imageURL":"../img/benluey.jfif"}],"frontMatter":{"slug":"Ignored_Messages","title":"Sorry: Ignored Messages","author":"BLuey","author_title":"Founder, qNimble","author_url":"https://www.linkedin.com/in/benluey","author_image_url":"../img/benluey.jfif","tags":[]},"prevItem":{"title":"Quarto Back in Stock","permalink":"/News/InStock"},"nextItem":{"title":"Initial Inventory Sold Out","permalink":"/News/SoldOut"}},"content":"If you tried to contact *qNimble* via our [contact us](/Contact) web-form from late November through early December and didn\'t hear from us, I\'m afraid it is because we lost your message. When you use the contact us web-form, an e-mail is sent to us and in late November we switched e-mail providers causing these e-mails to get blocked until we later updated some security-related email settings. Frustratingly, submissions did get an auto-reply e-mail from us saying we had received the message and would get back to you shortly, but this sadly was not that case. \\n\\nBecause we have a [privacy-focused website](/Privacy), we have no logs of the submissions and no way to know who contacted us. So let me apologize to anyone I ghosted. It was unintentional and entirely our fault. I\'m sorry. \\n\\nIf you want to get in touch with *qNimble* the [contact us](/Contact) link does work now, or you can call us at (720)-741-1556."},{"id":"SoldOut","metadata":{"permalink":"/News/SoldOut","source":"@site/News/2021-11-29-backorder.md","title":"Initial Inventory Sold Out","description":"Three weeks ago, we launched the Quarto and a partnered with Vescent who is our exclusive US distributor (press release) and already we have sold out of our initial inventory. This is exciting as early sales were much higher than expected, but unfortunately it means that we cannot ship from stock currently and any new orders will be delayed. We are working to get more *Quartos* made as soon as possible, but given the global chip shortage, this will take longer than we\'d like. For the latest update on availability and lead-time, please contact us.","date":"2021-11-29T00:00:00.000Z","formattedDate":"November 29, 2021","tags":[],"truncated":false,"authors":[{"name":"BLuey","title":"Founder, qNimble","url":"https://www.linkedin.com/in/benluey","imageURL":"../img/benluey.jfif"}],"frontMatter":{"slug":"SoldOut","title":"Initial Inventory Sold Out","author":"BLuey","author_title":"Founder, qNimble","author_url":"https://www.linkedin.com/in/benluey","author_image_url":"../img/benluey.jfif","tags":[]},"prevItem":{"title":"Sorry: Ignored Messages","permalink":"/News/Ignored_Messages"},"nextItem":{"title":"Vescent Exclusive US Distributor","permalink":"/News/Vescent_Distributor"}},"content":"Three weeks ago, we launched the *Quarto* and a partnered with [Vescent](https://vescent.com) who is our exclusive US distributor ([press release](/News/Vescent_Distributor)) and already we have sold out of our initial inventory. This is exciting as early sales were much higher than expected, but unfortunately it means that we cannot ship from stock currently and any new orders will be delayed. We are working to get more *Quartos* made as soon as possible, but given the [global chip shortage](https://en.wikipedia.org/wiki/2020\u20132022_global_chip_shortage), this will take longer than we\'d like. For the latest update on availability and lead-time, please [contact us](/Contact)."},{"id":"Vescent_Distributor","metadata":{"permalink":"/News/Vescent_Distributor","source":"@site/News/VescentUSDistributor.md","title":"Vescent Exclusive US Distributor","description":"asdf","date":"2021-11-08T00:00:00.000Z","formattedDate":"November 8, 2021","tags":[],"truncated":false,"authors":[],"frontMatter":{"slug":"Vescent_Distributor","title":"Vescent Exclusive US Distributor","tags":[],"date":"2021-11-08T00:00:00.000Z","hide_table_of_contents":true},"prevItem":{"title":"Initial Inventory Sold Out","permalink":"/News/SoldOut"},"nextItem":{"title":"New Website!","permalink":"/News/New_Website"}},"content":"import {Column, Row, Header} from \'../src/lib/format.js\'\\n\\n<Row><Column>\\n\\n![asdf](../static/img/Logo2-qNimble-ColorB.svg)\\n\\n</Column><Column>\\n\\n![asdf](../static/img/VescentNameAndMark.svg)\\n\\n</Column></Row>\\n\\n\\n\\n*qNimble* is excited to announce that [Vescent](https://vescent.com) will be the exclusive distributor of the *[Quarto](/Quarto)* in the United States. Vescent has been selling electro-optical solutions to academic, government, and commercial laboratories for over 15 years.  With a broad product portfolio ranging from incredibly low-noise laser current controllers to turn-key frequency combs, *qNimble* is pleased to work together with Vescent to bring you the finest in laboratory tools and instruments.\\n\\nFor online sales in the US, you can securely [order online](https://vescent.com/us/quarto.html), or you can [contact Vescent](https://vescent.com/contact). For technical questions or sales outside of the USA, please [contact *qNimble*](/Contact)."},{"id":"New_Website","metadata":{"permalink":"/News/New_Website","source":"@site/News/2021-03-09-welcome.md","title":"New Website!","description":"qNimble has a new website! It will hold all the documentation for the Quarto and should be much faster too. It also uses no cookies, is GDPR compliant and follows our new privacy policy. I hope you like it.","date":"2021-03-09T00:00:00.000Z","formattedDate":"March 9, 2021","tags":[],"truncated":false,"authors":[{"name":"BLuey","title":"Founder, qNimble","url":"https://www.linkedin.com/in/benluey","imageURL":"../img/benluey.jfif"}],"frontMatter":{"slug":"New_Website","title":"New Website!","author":"BLuey","author_title":"Founder, qNimble","author_url":"https://www.linkedin.com/in/benluey","author_image_url":"../img/benluey.jfif","tags":[]},"prevItem":{"title":"Vescent Exclusive US Distributor","permalink":"/News/Vescent_Distributor"}},"content":"*qNimble* has a new website! It will hold all the documentation for the *[Quarto](../Quarto)* and should be much faster too. It also uses no cookies, is GDPR compliant and follows our new [privacy policy](../privacy). I hope you like it."}]}')}}]);